// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwSearchBreadcrumbTitle from 'viewmodel/AwSearchBreadcrumbTitleViewModel';




/*
ctx imports
*/

const ctxImportObj = {  };




/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "refreshBreadCrumbTitle": {
            "actionType": "Event",
            "method": "Event",
            "inputData": {
                "events": [
                    {
                        "name": "refreshBreadCrumb",
                        "eventData": {
                            "searchFilterCategories": "",
                            "searchFilterMap": ""
                        }
                    }
                ]
            }
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "ctx": {
        "search.totalFound": null,
        "sublocation.label": null
    },
    "lifecycleHooks": {
        "onUpdate": {
            "action": "refreshBreadCrumbTitle",
            "observers": [
                "viewModel.ctx.search.totalFound",
                "viewModel.ctx.sublocation.label"
            ]
        }
    },
    "props": {
        "provider": {
            "type": "object"
        }
    },
    "_viewModelId": "AwDefaultBreadcrumb",
    "_uniqueViewModelId": "AwDefaultBreadcrumb"
};

/*
<aw-search-breadcrumb-title crumb-title='props.provider.title'></aw-search-breadcrumb-title>
*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <AwSearchBreadcrumbTitle crumbTitle={AwParseService.instance( "props.provider.title" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
    </AwSearchBreadcrumbTitle>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
